import axios from "axios";

export default function AllClasses(){
    const[classes, setClasses] = useState([]);
    

    useEffect(()=>{
        function getClasses() {
            axios.get("http://localhost:8070/class/").then((res)=>{
               setClasses(res.data);
               console.log(res);
        }).catch((err)=>{
            alert(err.message);
        })
        }
        getClasses();
    },[] ) 
    return(
        <div>
            <h1>All Classes</h1>
            <div>
            <input type='text' placeholder='Search users' />
            <input type='text' placeholder='Search users' />
            <p>{classes.classname}</p>

            {classes.map((el, index) => {
                console.log(el);
                return <h1 key={index}>{el.city}</h1>;
            })}
        </div>
        </div>
    )
    
}
